n=A.b([new A.dj("\ub0a0\uc528 \uc0c1\ud0dc\uc5d0 \ub530\ub978 \ub3d9\uc801 UI \ub80c\ub354\ub9c1 \ubb38\uc81c","\ub0a0\uc528 \ubcc0\ud654\uc5d0 \ub530\ub77c \ubc30\uacbd \uc774\ubbf8\uc9c0\uc640 UI \uc694\uc18c\ub4e4\uc774 \uc790\uc5f0\uc2a4\ub7fd\uac8c \uc804\ud658\ub418\uc9c0 \uc54a\uace0 \uae5c\ube61\uc784 \ud604\uc0c1 \ubc1c\uc0dd","UIView \uc560\ub2c8\uba54\uc774\uc158 \ucc98\ub9ac \ucd5c\uc801\ud654 \ubc0f \uc774\ubbf8\uc9c0 \ud504\ub9ac\ub85c\ub529 \uae30\ubc95 \uc801\uc6a9. \uc804\ud658 \ud6a8\uacfc\uc6a9 \ucee4\uc2a4\ud140 \ud2b8\ub79c\uc9c0\uc158 \ud074\ub798\uc2a4 \uad6c\ud604\uc73c\ub85c \uc790\uc5f0\uc2a4\ub7ec\uc6b4 UI \ubcc0\ud654 \uad6c\ud604","iOS\uc5d0\uc11c \ub3d9\uc801 \ud14c\ub9c8 \uc804\ud658\uacfc \ubd80\ub4dc\ub7ec\uc6b4 UI \uc560\ub2c8\uba54\uc774\uc158 \uad6c\ud604 \uae30\ubc95 \uc2b5\ub4dd"),new A.dj("\ubbf8\uc138\uba3c\uc9c0 \ub370\uc774\ud130 \uc2dc\uac01\ud654 \uc131\ub2a5 \uc800\ud558","\uc2e4\uc2dc\uac04 \ubbf8\uc138\uba3c\uc9c0 \ub370\uc774\ud130\ub97c \uadf8\ub798\ud504\ub85c \ud45c\ud604\ud560 \ub54c CPU \uc0ac\uc6a9\ub7c9\uc774 \uae09\uc99d\ud558\uace0 \uc560\ub2c8\uba54\uc774\uc158\uc774 \ubc84\ubc85\uc774\ub294 \ud604\uc0c1 \ubc1c\uc0dd","\uadf8\ub798\ud53d \ub80c\ub354\ub9c1 \ub85c\uc9c1 \ucd5c\uc801\ud654 \ubc0f Core Animation \ub808\uc774\uc5b4 \uce90\uc2f1 \uc801\uc6a9. \ubcf5\uc7a1\ud55c \uadf8\ub798\ud504 \ucef4\ud3ec\ub10c\ud2b8 \uc7ac\uc124\uacc4\ub85c \ub80c\ub354\ub9c1 \ud6a8\uc728\uc131 \ud5a5\uc0c1","iOS\uc758 \uadf8\ub798\ud53d \ub80c\ub354\ub9c1 \ud30c\uc774\ud504\ub77c\uc778\uacfc \ud6a8\uc728\uc801\uc778 \uc560\ub2c8\uba54\uc774\uc158 \ucc98\ub9ac \ubc29\ubc95\uc5d0 \ub300\ud55c \uc774\ud574 \uc2ec\ud654"),new A.dj("\uc704\uce58 \ubcc0\uacbd \uc2dc \ub0a0\uc528 \ub370\uc774\ud130 \ub3d9\uae30\ud654 \uc9c0\uc5f0","\uc0ac\uc6a9\uc790\uac00 \uc9c0\uc5ed\uc744 \ubcc0\uacbd\ud560 \ub54c \ub0a0\uc528 \uc815\ubcf4\uc640 UI\uac00 \uc989\uc2dc \uc5c5\ub370\uc774\ud2b8\ub418\uc9c0 \uc54a\uc544 \uc77c\uad00\uc131 \ubb38\uc81c \ubc1c\uc0dd","\uc704\uce58 \uc5c5\ub370\uc774\ud2b8 \uc774\ubca4\ud2b8 \ud578\ub4e4\ub9c1 \uac1c\uc120 \ubc0f API \uc694\uccad \ucd5c\uc801\ud654. \ub85c\uceec \uce90\uc2f1 \uc804\ub7b5 \ub3c4\uc785\uc73c\ub85c \uc774\uc804 \uac80\uc0c9 \uc9c0\uc5ed \ub370\uc774\ud130 \ube60\ub974\uac8c \ubcf5\uc6d0","\uc0ac\uc6a9\uc790 \uc785\ub825\uc5d0 \uc989\uac01\uc801\uc73c\ub85c \ubc18\uc751\ud558\ub294 \ubc18\uc751\ud615 \uc571 \uc124\uacc4 \ubc29\ubc95\uacfc \ub370\uc774\ud130 \ub3d9\uae30\ud654 \uc804\ub7b5 \uc2b5\ub4dd")],e)
n=A.qC("\ubd80\ud2b8\ucea0\ud504 \ud300 \ud504\ub85c\uc81d\ud2b8\ub85c \uc9c4\ud589\ud558\uba74\uc11c, \ub300\ubd80\ubd84\uc758 \ub0a0\uc528 \uc571\uc774 \ub2e8\uc870\ub86d\uace0 \ub531\ub531\ud55c UI\ub97c \uac00\uc9c0\uace0 \uc788\ub2e4\ub294 \n\uc810\uc5d0 \uc8fc\ubaa9\ud588\uc2b5\ub2c8\ub2e4. \ub0a0\uc528 \uc815\ubcf4\ub294 \ub9e4\uc77c \ud655\uc778\ud558\ub294 \uc815\ubcf4\uc784\uc5d0\ub3c4 \ubd88\uad6c\ud558\uace0 \uc2dc\uac01\uc801 \uc990\uac70\uc6c0\uc774 \n\ubd80\uc871\ud558\ub2e4\uace0 \ub290\uaf08\uc2b5\ub2c8\ub2e4. \uc774\uc5d0 \uc560\ub2c8\uba54\uc774\uc158\uacfc \uc2dc\uac01\uc801 \uc694\uc18c\ub97c \ud48d\ubd80\ud558\uac8c \ud65c\uc6a9\ud55c \uadc0\uc5ec\uc6b4 \n\ub0a0\uc528 \uc571\uc744 \ub9cc\ub4e4\uc5b4 \uc0ac\uc6a9\uc790 \uacbd\ud5d8\uc744 \ud5a5\uc0c1\uc2dc\ud0a4\uace0\uc790 \ud588\uc2b5\ub2c8\ub2e4.\n",f,null,"\uae30\uc874\uc5d0 \uce59\uce59\ud55c \ub0a0\uc528 \uc571\uc744 \ub5a0\ub098 \uc5d0\ub2c8\uba54\uc774\uc158\uc5d0 \uc911\uc810\uc744 \ub454 \ub0a0\uc528 \uc571 \uc785\ub2c8\ub2e4.","https://github.com/NBCampArchive/Today-s_weather","3","images/weather.png",A.b(["improvements"],j),g,"\uc774 \ud504\ub85c\uc81d\ud2b8\ub97c \ud1b5\ud574 OpenWeatherMap API\ub97c \ud65c\uc6a9\ud55c \uc678\ubd80 \ub370\uc774\ud130 \ucc98\ub9ac\uc640 \n\ubcf5\uc7a1\ud55c \uc560\ub2c8\uba54\uc774\uc158 \uad6c\ud604 \ub2a5\ub825\uc744 \ud5a5\uc0c1\uc2dc\ud0ac \uc218 \uc788\uc5c8\uc2b5\ub2c8\ub2e4. \ud2b9\ud788 \ub0a0\uc528 \uc0c1\ud0dc\uc5d0 \ub530\ub77c \n\ub3d9\uc801\uc73c\ub85c \ubcc0\ud654\ud558\ub294 UI/UX\ub97c \uad6c\ud604\ud558\uba74\uc11c Swift \uc560\ub2c8\uba54\uc774\uc158 \uc2dc\uc2a4\ud15c\uc5d0 \ub300\ud55c \uae4a\uc740 \n\uc774\ud574\ub97c \uc5bb\uc5c8\uc2b5\ub2c8\ub2e4. \ub610\ud55c \ub0a0\uc528, \ubbf8\uc138\uba3c\uc9c0 \ub4f1 \ub2e4\uc591\ud55c \ud658\uacbd \ub370\uc774\ud130\ub97c \uc2dc\uac01\uc801\uc73c\ub85c \n\ud6a8\uacfc\uc801\uc73c\ub85c \ud45c\ud604\ud558\ub294 \ub514\uc790\uc778 \ub2a5\ub825\uc744 \ud0a4\uc6b8 \uc218 \uc788\uc5c8\uc2b5\ub2c8\ub2e4.\n","2024.05.14 ~ 2024.05.25",h,"openweathermap API\ub97c \ud65c\uc6a9\ud558\uc5ec \ub0a0\uc528 \uc608\ubcf4 \ubc0f \ubbf8\uc138\uba3c\uc9c0 \uce21\uc815 \uc5b4\ud50c\ub9ac\ucf00\uc774\uc158","iOS 3\uc778",i,"\uc624\ub298\uc758 \ub0a0\uc528",n)
