m=A.b([new A.dj("API \uc751\ub2f5 \ub370\uc774\ud130 \ud30c\uc2f1 \uc624\ub958","TheMovie DB API\uc5d0\uc11c \ubc1b\uc544\uc628 \ubcf5\uc7a1\ud55c JSON \uad6c\uc870\ub97c \ucc98\ub9ac\ud558\ub294 \uacfc\uc815\uc5d0\uc11c \ud2b9\uc815 \uc601\ud654 \uc815\ubcf4\uac00 \ub204\ub77d\ub418\uac70\ub098 \uc798\ubabb \ud45c\uc2dc\ub418\ub294 \ubb38\uc81c \ubc1c\uc0dd","\uacac\uace0\ud55c \ub370\uc774\ud130 \ubaa8\ub378 \uc124\uacc4 \ubc0f \uc635\uc154\ub110 \uccb4\uc774\ub2dd\uc744 \ud65c\uc6a9\ud55c \uc548\uc804\ud55c \ud30c\uc2f1 \ub85c\uc9c1 \uad6c\ud604. \uc608\uc678 \ucf00\uc774\uc2a4\uc5d0 \ub300\ud55c \ucc98\ub9ac \uac15\ud654 \ubc0f \ub370\uc774\ud130 \uac80\uc99d \ub2e8\uacc4 \ucd94\uac00","\uc678\ubd80 API \uc751\ub2f5 \ucc98\ub9ac \uc2dc \uc548\uc815\uc131\uacfc \uc624\ub958 \ub0b4\uc131\uc744 \uace0\ub824\ud55c \ubaa8\ub378\ub9c1 \ubc29\ubc95\uacfc JSON \ud30c\uc2f1 \uae30\ubc95 \uc2b5\ub4dd"),new A.dj("\uc608\ub9e4 \uc2dc\uc2a4\ud15c \ub3d9\uc2dc\uc131 \ubb38\uc81c","\ub2e4\uc218 \uc0ac\uc6a9\uc790\uac00 \ub3d9\uc2dc\uc5d0 \uac19\uc740 \uc88c\uc11d\uc744 \uc608\ub9e4\ud558\ub824 \ud560 \ub54c \uc911\ubcf5 \uc608\ub9e4 \ud604\uc0c1 \ubc1c\uc0dd","\uc88c\uc11d \uc608\uc57d \uc0c1\ud0dc \uc2e4\uc2dc\uac04 \uc5c5\ub370\uc774\ud2b8 \uba54\ucee4\ub2c8\uc998 \uad6c\ud604 \ubc0f \uc11c\ubc84 \ud1b5\uc2e0 \ucd5c\uc801\ud654. \ub099\uad00\uc801 \uc7a0\uae08\uacfc \ucda9\ub3cc \ud574\uacb0 \ub85c\uc9c1 \uc801\uc6a9\uc73c\ub85c \uc0ac\uc6a9\uc790 \uacbd\ud5d8 \uac1c\uc120","\ub3d9\uc2dc\uc131 \uc81c\uc5b4\uc640 \ubd84\uc0b0 \uc2dc\uc2a4\ud15c\uc5d0\uc11c\uc758 \ub370\uc774\ud130 \uc77c\uad00\uc131 \uc720\uc9c0 \ubc29\ubc95\uc5d0 \ub300\ud55c \uc774\ud574 \ud5a5\uc0c1"),new A.dj("\uc2a4\ud1a0\ub9ac\ubcf4\ub4dc \uae30\ubc18 UI \ud655\uc7a5\uc131 \ud55c\uacc4","\uc571 \uaddc\ubaa8\uac00 \ucee4\uc9c0\uba74\uc11c \uc2a4\ud1a0\ub9ac\ubcf4\ub4dc \uae30\ubc18 UI \uad00\ub9ac\uc758 \uc5b4\ub824\uc6c0\uacfc Git \ucda9\ub3cc \ubb38\uc81c \ubc1c\uc0dd","\uc2a4\ud1a0\ub9ac\ubcf4\ub4dc\ub97c \uae30\ub2a5\ubcc4\ub85c \ubd84\ub9ac\ud558\uace0 XIB \ud30c\uc77c \ud65c\uc6a9. \ucf54\ub4dc \uae30\ubc18 UI \ucef4\ud3ec\ub10c\ud2b8 \ub3c4\uc785\uc73c\ub85c \uc7ac\uc0ac\uc6a9\uc131 \ud5a5\uc0c1 \ubc0f \ubaa8\ub4c8\ud654 \uc124\uacc4 \uc801\uc6a9","\ub300\uaddc\ubaa8 iOS \ud504\ub85c\uc81d\ud2b8\uc5d0\uc11c\uc758 \ud6a8\uc728\uc801\uc778 UI \uad00\ub9ac \uc804\ub7b5\uacfc \ud300 \ud611\uc5c5\uc744 \uc704\ud55c \ucf54\ub4dc \uad6c\uc870\ud654 \ubc29\ubc95 \uc2b5\ub4dd")],e)
m=A.qC("\uc601\ud654 \uc815\ubcf4\ub97c \uc27d\uac8c \ucc3e\uc544\ubcf4\uace0 \uc608\ub9e4\ud560 \uc218 \uc788\ub294 \ud1b5\ud569 \ud50c\ub7ab\ud3fc\uc744 \ub9cc\ub4e4\uace0\uc790 \ud588\uc2b5\ub2c8\ub2e4.\nTheMovie DB API\ub97c \ud65c\uc6a9\ud558\uc5ec \ud48d\ubd80\ud55c \uc601\ud654 \uc815\ubcf4\ub97c \uc81c\uacf5\ud558\uace0, \n\uc0ac\uc6a9\uc790 \uce5c\ud654\uc801\uc778 \uc608\ub9e4 \uc2dc\uc2a4\ud15c\uc744 \uad6c\ud604\ud558\uace0\uc790 \ud588\uc2b5\ub2c8\ub2e4.\n",g,null,"TheMovie DB API\ub97c \ud65c\uc6a9\ud558\uc5ec \uc601\ud654 \uc815\ubcf4\ub97c \uc81c\uacf5\ud558\uace0 \uc608\ub9e4\ud560 \uc218 \uc788\ub294 \uc571\uc785\ub2c8\ub2e4.","https://github.com/NBCampArchive/CinemaApp","4","images/twelvecinema.png",A.b(["\uacb0\uc81c \uc2dc\uc2a4\ud15c \uc5f0\ub3d9","\ucd94\ucc9c \uc54c\uace0\ub9ac\uc998 \uace0\ub3c4\ud654","\uc131\ub2a5 \ucd5c\uc801\ud654"],j),i,"\uc678\ubd80 API \uc5f0\ub3d9\uacfc \ub370\uc774\ud130 \ucc98\ub9ac, UI \uad6c\ud604 \ub4f1 iOS \uc571 \uac1c\ubc1c\uc758 \n\uae30\ubcf8\uc801\uc778 \uc694\uc18c\ub4e4\uc744 \uc2e4\uc2b5\ud574\ubcfc \uc218 \uc788\uc5c8\uc2b5\ub2c8\ub2e4. \ud2b9\ud788 StoryBoard\ub97c \n\ud65c\uc6a9\ud55c UI \uac1c\ubc1c\uacfc MVC \ud328\ud134 \uc801\uc6a9\uc744 \uacbd\ud5d8\ud588\uc2b5\ub2c8\ub2e4.\n","2024.04.22 ~ 2024.04.28",f,"TheMovie DB API\ub97c \ud65c\uc6a9\ud55c \uc601\ud654 \uc815\ubcf4 \ubc0f \uc608\ub9e4 \uc2dc\uc2a4\ud15c","iOS 4\uc778",h,"Twelve Cinema",m)
